//#######################################################################################################################

def projectPath = testRunner.testCase.testSuite.project
def testSuitePath = testRunner.testCase.testSuite
def testCasePath = testRunner.testCase
log.info projectPath.getTestSuiteByName("Regression Test 1.2").getTestCaseByName("Divide TestCase").getTestStepByName("Divide").getPropertyValue("Request")

//set global properties
com.eviware.soapui.SoapUI.globalProperties.setPropertyValue("d","setThroGroovy")

//set project level properties

testRunner.testCase.testSuite.project.setPropertyValue("d","SetBymethrGroovyat project level")
	//or
	//projectPath.setPropertyValue("d","SetBymethrGroovyat project level")

//set testSuite properties
testRunner.testCase.testSuite.setPropertyValue("d","SetTestSuiteProperty")
	//testSuitePath.setPropertyValue("d","SetTestSuitePropertyyyyy")

//set testSuite properties fr outside testSuite
projectPath.getTestSuiteByName("Regression Test 1.2").setPropertyValue("d","SetFrMUtsideGroovy")

//set testCase ptoperties
testRunner.testCase.setPropertyValue("d","SetATTestCaseLevel22")
//testCasePath.setPropertyValue("d","SetATTestCaseLevel")

//set testStep ptoperties

testRunner.testCase.getTestStepByName("TestStepProperty").setPropertyValue("d","setByGroovy")
testRunner.testCase.getTestStepByName("Add").setPropertyValue("Username","setByGroovy")


import com.eviware.soapui.support.XmlHolder

import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

//Access XML request through groovy 


def xmlReq = testRunner.testCase.getTestStepByName("Add").getPropertyValue("Request")
def a = testRunner.testCase.getPropertyValue("a")
def b = testRunner.testCase.getPropertyValue("b")
log.info a+b
def aa = a.toInteger()
def bb = b.toInteger()
log.info aa+bb

//Xml parsing

//define new XmlHolder object
def sampleXmlRequest = new XmlHolder(xmlReq)

//add the values into that perticular xml at perticular node

sampleXmlRequest.setNodeValue("//tem:Add/tem:intA",a)
sampleXmlRequest.setNodeValue("//tem:Add/tem:intB",b)

def finalXml = sampleXmlRequest.getXml()

testRunner.testCase.getTestStepByName("Add").setPropertyValue("Request",finalXml)

def addReqTest = testRunner.testCase.getTestStepByName("Add")
def contextAddReqTest = new WsdlTestRunContext(addReqTest)

addReqTest.run(testRunner,contextAddReqTest)


