//varify xml response

//get response xml
def addXmlResponse = testRunner.testCase.getTestStepByName("Add").getPropertyValue("Response")
//parse response xml(need obj of XmlHolder)
//get node by 
def addXmlReponseFinal = new XmlHolder(addXmlResponse)

//addXmlReponseFinal this is used to get node values of response
def responseValue = addXmlReponseFinal.getNodeValue("//*:AddResult") 

def responseValueFinal = responseValue.toInteger()
//varify final value

//assert responseValueFinal == aa+bb


if(responseValueFinal == aa+bb) 
{
	log.info "pass"
}else{
log.info "failed"
}
